import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import data from './data'
import Nav from './Nav'
function card(val){
  return(

    <Card  imgsrc={val.imgsrc}
    title={data[0].title}
    name={data[0].name}
    links={data[0].links}/>

  )}

ReactDOM.render(
  <React.StrictMode>
    <Nav>
      </Nav>

 {data.map(card)};


  </React.StrictMode>,
  document.getElementById('root')
);

